import React from "react";
import {Card} from "antd";

const Simple = () => {
  return (

    <Card title="Simple card">
      <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>

      <p>Where does it come from? Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots of
        classical, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in
        Virginia, consectetur, discovered the undoubtable source.</p>

      <p>Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and
        the like).</p>

      <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
    </Card>

  );
};

export default Simple;
